CREATE DATABASE IF NOT EXISTS `shellql`;

CREATE USER 'shellql'@'%' IDENTIFIED BY 'shellql';

GRANT USAGE ON * . * TO 'shellql'@'%' IDENTIFIED BY 'shellql' WITH MAX_QUERIES_PER_HOUR 0 MAX_CONNECTIONS_PER_HOUR 0 MAX_UPDATES_PER_HOUR 0 MAX_USER_CONNECTIONS 0 ;

GRANT SELECT ON `shellql` . * TO 'shellql'@'%';

USE `shellql`;

CREATE TABLE Stake ( RowID integer primary key , LName text , Default_Buyin real not null default 0, SmallBlind_Amount real not null default 0, BigBlind_Amount real not null default 0, Second_BB_Amount real not null default 0, NumBBDeep INTEGER not null default 100, BlindLength INTEGER not null default 0, Tournament INTEGER not null default 0, DeepStacked INTEGER not null default 0 );
CREATE TABLE SessionPerf (_id integer primary key , FK_Session_id integer not null, BasicPerformance integer not null, GoalPerformance integer default 0 , GoalPerformance2 integer default 0 , GoalPerformance3 integer default 0 , Variance integer default 0 , SessionDur real default 0 , CreateDate text, Note TEXT );
CREATE TABLE SessionNote ( RowID integer primary key , create_date text, Fk_Session_Id integer not null   references Session (RowID) on delete restrict, Won_Lost text , note text );
CREATE TABLE Session ( RowID integer primary key , Player text not null, Location integer not null, Stakes integer not null, CreateDate text, Date_Played text, Hours real not null, Profit real not null, Type integer not null, Episode_Start text, Break_Hours real not null, Session_End text, Rebuy real not null default 0, Rebuy_Cnt integer not null default 0,Cash_out real not null default 0, Buyin real not null default 0,FK_PokerTable integer not null default 0, Break_Start text , IsTournament integer not null default 0 , Profit_Home_Conversion_Rate real default 1, Profit_Currency_Code text , Profit_Home_Currency_Code text , Profit_Home REAL default 0, GoalExecution integer default 0, WarmdownRecorded integer default 0, Variance integer default 0, YourPlay integer default 0, Difficulty integer default 0, SessionGoal1 integer default 0, SessionGoal2 integer default 0, SessionGoal3 integer default 0, AutoPauseFutureTime text, Tournament_Place TEXT , Tournament_Entries TEXT);
CREATE TABLE Round ( RowID integer primary key , FK_Hand_ID integer not null, TheRound integer default 0);
CREATE TABLE PokerTable (_id integer primary key , Seat1 integer, Seat2 integer,  Seat3 integer,  Seat4 integer, Seat5 integer, Seat6 integer, Seat7 integer,  Seat8 integer,  Seat9 integer, Seat10 integer, Seat11 text, Seat1Enabled boolean default true, Seat2Enabled boolean default true, Seat3Enabled boolean default true, Seat4Enabled boolean default true, Seat5Enabled boolean default true, Seat6Enabled boolean default true, Seat7Enabled boolean default true, Seat8Enabled boolean default true, Seat9Enabled boolean default true, Seat10Enabled boolean default true, Seat11Enabled boolean default true, tablename text , isCurrent boolean default false, tablecreate text,ButtonPosition INTEGER default 0, FK_Session_Id INTEGER not null, TableProfit REAL not null default 0, TableCashOut REAL not null default 0, TableRebuy REAL not null default 0, TableDuration REAL not null default 0, TableBuyin REAL not null default 0, TableDiff  TEXT , TableType  TEXT , Is10H INTEGER default 0  references Session (RowID) on delete restrict );
CREATE TABLE PokerHand_Table ( RowID integer primary key , FK_Hand_ID integer not null, FK_Player_ID integer not null, PlrActive integer default 0, isHero integer default 0, StackSizeStart real default 0, HoleCard_Rank_1 integer default 0, HoleCard_Suit_1 integer default 0, HoleCard_Rank_2 integer default 0, HoleCard_Suit_2 integer default 0, PFActions text , FlopActions text , TurnActions text , RiverActions text , Position text , ProftLoss real default 0, SawFlop integer default 0, PFR integer default 0, ThreeBetPF integer default 0, CBFlop integer default 0, CanCBFlop integer default 0, XRFlop integer default 0, CanXRFlop integer default 0, DonkFlop integer default 0, CanDonkFlop integer default 0, FlopFoldToCB integer default 0, CanFlopFoldToCB integer default 0, CheckCallFlop integer default 0, CheckFoldFlop integer default 0, RaiseFlopCB integer default 0, CanRaiseFlopCB integer default 0, FlopBetWhenCBMissed integer default 0, FlopCheckCBMissed integer default 0, TurnBetWhenCBMissed integer default 0, TurnCheckCBMissed integer default 0, CBTurn integer default 0, CanCBTurn integer default 0, TurnFoldToCB integer default 0, CanTurnFoldToCB integer default 0, HowManySawFlop integer default 0, HowManySawTurn integer default 0, HowManyHanded integer default 0, BetFlop INTEGER default 0, CanBetFlop INTEGER default 0);
CREATE TABLE PokerHand ( RowID integer primary key , CreateDate text, FK_Stakes_ID integer not null, FK_Location_ID integer not null, FK_Session_ID integer not null, ButtonPos integer not null, PotSize real not null, FK_Winner_ID integer not null, WinningSeat integer default 0, BoardCard_Rank_1 integer default 0, BoardCard_Suit_1 integer default 0, BoardCard_Rank_2 integer default 0, BoardCard_Suit_2 integer default 0, BoardCard_Rank_3 integer default 0, BoardCard_Suit_3 integer default 0, BoardCard_Rank_4 integer default 0, BoardCard_Suit_4 integer default 0, BoardCard_Rank_5 integer default 0, BoardCard_Suit_5 integer default 0, HandHtml text , PreFlopNotes text , FlopNotes text , TurnNotes text , RiverNotes text , IsAnalyzed integer default 0, IsMarked integer default 0, WasQuickSaved integer default 0);
